import React from 'react';
import { Link } from 'react-router-dom';

const Registro = () => {
  return <div className='container'>
    <h1> Crea tu cuenta </h1>

<div className="container" >
    <div className="form-group">
      <input type="text" id="createName" className="form-control" placeholder="Nombre de usuario"/>
     </div>
     <div className="form-group">
      <input type="email" id="mailRegister" className="form-control"  placeholder="correo@ejemplo.com" pattern="^\\S+@\\S+\\.\\S+$" required/>
      </div>
      <input type="password" id="passwordRegister" className="form-control"  placeholder="contraseña" />
      </div>


      <button id = "btnRegister" type="button" className="btn btn-outline-success"> Registrar </button>

     <p className= "info"> ¿Ya tienes una cuenta? <Link to = {`/login`}> Inicia sesión </Link> </p>
     </div>
};

export default Registro;
